svg.script:
var dice_spiral = {

  initialize: function(elem, prototype) {
    if (!prototype) {
      return
    }
    prototype.querySelectorAll('g').forEach((gEl) => {
      if (gEl.id && elem.getElementById(gEl.id)) {
        elem.getElementById(gEl.id).setAttribute(
          'display',
          gEl.getAttribute('display'),
        )
      }
    })
  },

  menu: {
    'Roll': {
      eventName: 'die_roll',
      otherEvents: ['dblclick'],
      applicable: (dieNode) => { return true },
      handler: function(evt) {
        let faces = [
          'g_spiral', 'g_spiral',
          'g_foot', 'g_foot', 'g_foot2',
          'g_bang_foot', 'g_bang', 'g_bang2',
          'g_bang2_spiral', 'g_bang_spiral', 'g_bang_spiral',
          null,
        ]
        return sw_dice.roll_handler(this, faces)
      },
    },
  },

  getValue: function(elem) {
    console.log('getValue', elem)
    let val = []
    let allValues = {
      'g_spiral': ['Spiral'],
      'g_foot': ['Foot'],
      'g_foot2': ['Foot', 'Foot'],
      'g_bang_foot': ['Foot', 'Bang'],
      'g_bang': ['Bang'],
      'g_bang2': ['Bang', 'Bang'],
      'g_bang_spiral': ['Spiral', 'Bang'],
      'g_bang2_spiral': ['Spiral', 'Bang', 'Bang'],
    }
    elem.querySelectorAll('.face').forEach(f => {
      if (f.style.display !== 'none') {
        val = allValues[f.id]
      }
    })
    return val
  },

}
